INSERT INTO `db_data_dictionary_detail` VALUES (1,4,'CPU 信息查询','cat /proc/cpuinfo |grep \"model name\" && cat /proc/cpuinfo |grep \"physical id\"',1,1,'2022-03-19 17:50:28',-1,-1,'2022-03-19 17:50:28'),(2,5,'内存大小查询','cat /proc/meminfo |grep MemTotal',1,1,'2022-03-19 18:01:29',-1,-1,'2022-03-19 18:01:29'),(3,6,'磁盘信息','# 查看：文件系统  容量  已用  可用  已用占比   挂载点\ndf -h\n\n# 列出所有可用块设备的信息\nlsblk\n\n# 格式化硬盘\nmkfs.ext4 /dev/vdb\n\n# 硬盘挂载。\n# /dev/vdb 硬盘\n# /data 目录\nsudo mount /dev/vdb /data\n\n\n\n# 查看具体目录挂在\ndf /tmp -h',1,1,'2022-03-19 19:26:13',-1,-1,'2022-03-19 19:26:13'),(4,7,'转译字符','在XML中，需要转义的字符有： \r\n	(1)&　　　&amp; \r\n	(2)<　　　&lt;         或者 <![CDATA[ < ]]>\r\n	(3)>　　　&gt; \r\n	(4)＂　　　&quot; \r\n	(5)＇　　　&apos; \r\n	\r\n	但是严格来说，在XML中只有”<”和”&”是非法的，其它三个都是可以合法存在的，但是，把它们都进行转义是一个好的习惯。\r\n\r\n值得注意的是： \r\n　　(1)转义序列字符之间不能有空格； \r\n　　(2) 转义序列必须以”;”结束； \r\n　　(3) 单独出现的”&”不会被认为是转义的开始； \r\n　　(4) 区分大小写。\r\n\r\n\r\n不管怎么样，转义前的字符也好，转义后的字符也好，都会被xml解析器解析，\r\n为了方便起见，使用<![CDATA[]]>来包含不被xml解析器解析的内容。\r\n但要注意的是： 　　\r\n	(1) 此部分不能再包含”]]>”； 　　\r\n	(2) 不允许嵌套使用； 　　\r\n	(3)”]]>”这部分不能包含空格或者换行。\r\n	　　\r\n最后，说说<![CDATA[]]>和xml转移字符的关系，它们两个看起来是不是感觉功能重复了？ 　　\r\n	是的，它们的功能就是一样的，只是应用场景和需求有些不同： 　　\r\n		(1)<![CDATA[]]>不能适用所有情况，转义字符可以； 　　\r\n		(2) 对于短字符串<![CDATA[]]>写起来啰嗦，对于长字符串转义字符写起来可读性差； 　　\r\n		(3) <![CDATA[]]>表示xml解析器忽略解析，所以更快。 \r\n		\r\n		\r\n\r\n<![CDATA[]]>使用举例\r\n	(1)\r\n		<![CDATA[ < ]]>\r\n	(2)	\r\n		<select id=\"selectRulesByAjrescuearlike\" parameterType=\"com.hand.anji.kupreceivable.dto.AjrescuearlikeDto\" resultType = \"java.lang.Integer\">\r\n			<![CDATA[\r\n				SELECT COUNT(*) FROM AJ_RESCUE_AR_LINE\r\n				WHERE CUSTOMER_ID = #{customerId,jdbcType=VARCHAR}\r\n				AND SOURCE_LOCATION_GID = #{sourceLocationGid,jdbcType=VARCHAR}\r\n				AND DEST_LOCATION_GID = #{destLocationGid,jdbcType=VARCHAR}\r\n			]]>\r\n		</select>\r\n',1,1,'2022-03-25 22:41:04',-1,-1,'2022-03-25 22:41:04'),(6,9,'POST请求示例','前后端传值方法一：只传一个参数\n\n//前端\n<#include \"../include/head.html\">\n<html>\n<head>\n    <title>login test</title>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta http-equiv=\"pragma\" content=\"no-cache\">\n    <meta http-equiv=\"cache-control\" content=\"no-cache\">\n    <meta http-equiv=\"expires\" content=\"0\">\n    <meta http-equiv=\"keywords\" content=\"keyword1,keyword2,keyword3\">\n    <meta http-equiv=\"description\" content=\"ajax方式\">\n    <script src=\"http://apps.bdimg.com/libs/jquery/2.1.4/jquery.min.js\"></script>\n    <script type=\"text/javascript\">\n        function login() {\n        	var username = $(\"#txtUserName\").val();\n        	var password = $(\"#TextBox2\").val();\n        	\n			var values = 100;     //要传的值\n        	\n        	console.log(values);\n			\n            $.ajax({\n				//async:false,   //ajax的执行原本是异步的，这个属性可以让Ajax执行完后再执行下一个Ajax\n				//几个参数需要注意一下\n                type: \"POST\",    //方法类型\n                dataType: \"json\",                //预期服务器返回的数据类型为json\n                url: \"${base.contextPath}/jquery/transmit\",\n                data:{\"values\":values},     //传值\n                success: function (result) {\n                    if (result.success==true) {\n                    	alert(result.message);\n                    };\n                },\n                error : function(result) {\n                    alert(result.message);\n                }\n            });\n        }\n    </script>\n</head>\n<body style=\"background:#D9E5EF\">\n<div id=\"form-div\">\n    <form id=\"form1\" onsubmit=\"return false\" action=\"${base.contextPath}/apCost/getShipMent\" method=\"post\">\n        <p>用户名：<input name=\"userName\" type=\"text\" id=\"txtUserName\" tabindex=\"1\" size=\"15\" value=\"\"/></p>\n        <p>密　码：<input name=\"password\" type=\"password\" id=\"TextBox2\" tabindex=\"2\" size=\"16\" value=\"\"/></p>\n        <p><input type=\"button\" value=\"登录\" onclick=\"login()\">&nbsp;<input type=\"reset\" value=\"重置\"></p>\n    </form>\n</div>\n</body>\n</html>\n\n//后端Controller\n@RequestMapping(value = \"/jquery/transmit\", method = RequestMethod.POST)\npublic ResponseData getShipMent(HttpServletRequest request, \n								HttpServletResponse response,\n								String values) throws Exception {//后端接收前端传过来的值 方法一：定义用String values接收前端传过来的值\n	ResponseData rd = new ResponseData();\n	try{\n	String text = request.getParameter(\"values\"); //后端接收前端值 方法二\n	rd.setSuccess(true);\n	rd.setMessage(\"hello\");\n	return rd;\n	}catch(Exception e){\n		rd.setSuccess(false);\n		rd.setMessage(\"lose\");\n		e.printStackTrace();\n	}\n	return rd;\n}\n\n\n前后端传值方法二：传多个值\n//前端\n<#include \"../include/head.html\">\n<html>\n<head>\n    <title>login test</title>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta http-equiv=\"pragma\" content=\"no-cache\">\n    <meta http-equiv=\"cache-control\" content=\"no-cache\">\n    <meta http-equiv=\"expires\" content=\"0\">\n    <meta http-equiv=\"keywords\" content=\"keyword1,keyword2,keyword3\">\n    <meta http-equiv=\"description\" content=\"ajax方式\">\n    <script src=\"http://apps.bdimg.com/libs/jquery/2.1.4/jquery.min.js\"></script>\n    <script type=\"text/javascript\">\n        function login() {\n        	var username = $(\"#txtUserName\").val();\n        	var password = $(\"#TextBox2\").val();\n        	\n            $.ajax({\n				//几个参数需要注意一下\n                type: \"POST\",   //方法类型\n                dataType: \"json\",                //预期服务器返回的数据类型为json\n                url: \"${base.contextPath}/jquery/transmit\" ,\n                data: {\"username\":username,\"password\":password},            \n                success: function (result) {\n                    if (result.success==true) {\n                    	alert(result.message);\n                    }\n                    ;\n                },\n                error : function(result) {\n                    //alert(\"异常！\");\n                    alert(result.message);\n                }\n            });\n        }\n    </script>\n    \n   \n</head>\n<body style=\"background:#D9E5EF\">\n<div id=\"form-div\">\n    <form id=\"form1\" onsubmit=\"return false\" action=\"${base.contextPath}/apCost/getShipMent\" method=\"post\">\n        <p>用户名：<input name=\"userName\" type=\"text\" id=\"txtUserName\" tabindex=\"1\" size=\"15\" value=\"\"/></p>\n        <p>密　码：<input name=\"password\" type=\"password\" id=\"TextBox2\" tabindex=\"2\" size=\"16\" value=\"\"/></p>\n        <p><input type=\"button\" value=\"登录\" onclick=\"login()\">&nbsp;<input type=\"reset\" value=\"重置\"></p>\n    </form>\n</div>\n</body>\n</html>\n\n//后端Controller\n@RequestMapping(value = \"/jquery/transmit\", method = RequestMethod.POST)\npublic ResponseData getShipMent(HttpServletRequest request, \n								HttpServletResponse response,\n								String userName,String password) throws Exception {  //定义userName和password用来接收前端传来的多个值\n	ResponseData rd = new ResponseData();\n	try{\n\n	String user = userName;	\n	String pass = password;\n\n	rd.setSuccess(true);\n	rd.setMessage(\"hello\");\n	return rd;\n	}catch(Exception e){\n		rd.setSuccess(false);\n		rd.setMessage(\"lose\");\n		e.printStackTrace();\n	}\n	return rd;\n}\n\n\n\n\n前后端传值方法三：传整个form控件\n//前端\n<#include \"../include/head.html\">\n<html>\n<head>\n    <title>login test</title>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta http-equiv=\"pragma\" content=\"no-cache\">\n    <meta http-equiv=\"cache-control\" content=\"no-cache\">\n    <meta http-equiv=\"expires\" content=\"0\">\n    <meta http-equiv=\"keywords\" content=\"keyword1,keyword2,keyword3\">\n    <meta http-equiv=\"description\" content=\"ajax方式\">\n    <script src=\"http://apps.bdimg.com/libs/jquery/2.1.4/jquery.min.js\"></script>\n    <script type=\"text/javascript\">\n        function login() {\n\n        	console.log($(\'#form1\').serialize());\n			\n            $.ajax({\n				//几个参数需要注意一下\n				//async:false,   //ajax的执行原本是异步的，这个属性可以让Ajax执行完后再执行下一个Ajax\n                type: \"POST\",   //方法类型\n                dataType: \"json\",                //预期服务器返回的数据类型为json\n                url: \"${base.contextPath}/jquery/transmit\" ,\n                data: $(\'#form1\').serialize(),     //将id为form1的控件序列化并传递   \n                success: function (result) {\n                    console.log(result);//打印服务端返回的数据(调试用)\n                    if (result.success==true) {\n                    	alert(result.message);\n                    }\n                    ;\n                },\n                error : function(result) {\n                    //alert(\"异常！\");\n                    alert(result.message);\n                }\n            });\n        }\n    </script>\n    \n   \n</head>\n<body style=\"background:#D9E5EF\">\n<div id=\"form-div\">\n    <form id=\"form1\" onsubmit=\"return false\" action=\"${base.contextPath}/apCost/getShipMent\" method=\"post\">\n        <p>用户名：<input name=\"userName\" type=\"text\" id=\"txtUserName\" tabindex=\"1\" size=\"15\" value=\"\"/></p>\n        <p>密　码：<input name=\"password\" type=\"password\" id=\"TextBox2\" tabindex=\"2\" size=\"16\" value=\"\"/></p>\n        <p><input type=\"button\" value=\"登录\" onclick=\"login()\">&nbsp;<input type=\"reset\" value=\"重置\"></p>\n    </form>\n</div>\n</body>\n</html>\n\n//后端Controller\n@RequestMapping(value = \"/jquery/transmit\", method = RequestMethod.POST)\npublic ResponseData getShipMent(HttpServletRequest request, HttpServletResponse response,String userName,String password) throws Exception { //form控件中的值会自动对上		\n	ResponseData rd = new ResponseData();\n	try{\n	String user = userName;	\n	String pass = password;\n\n	System.out.println(user+pass);\n	rd.setSuccess(true);\n	rd.setMessage(\"hello\");\n	return rd;\n	}catch(Exception e){\n		rd.setSuccess(false);\n		rd.setMessage(\"lose\");\n		e.printStackTrace();\n	}\n	return rd;\n}\n\n//方法四：传选择的数据\n//***************************************************************HTML层\n<#include \"../../include/header.html\" />\n<script src=\"${base.contextPath}/lib/bootstrap-3.3.7/js/bootstrap.min.js\"></script>\n<script src=\"${base.contextPath}/common/code?OrderStatusData=OUTBOUND_MATE_HEADER_STATUS\" type=\"text/javascript\"></script>\n<script src=\"${base.contextPath}/common/code?BusinessTypeData=STOCKOUT_BUSINESSTYPE\" type=\"text/javascript\"></script>\n<script src=\"${base.contextPath}/common/code?OrderDetailStatusData=OUTBOUND_MATE_LINE_STATUS\" type=\"text/javascript\"></script>\n<script src=\"${base.contextPath}/common/code?UnitTypeData=GOODS.UNIT\" type=\"text/javascript\"></script>\n<script src=\"${base.contextPath}/common/code?materialBilltype=MATERIAL.BILLTYPE\" type=\"text/javascript\"></script>\n<body>\n\n<script type=\"text/javascript\">\n    var detailData = null;\n    //浏览区的viewModel\n    var viewModel = kendo.observable({\n        model: {},\n        browseDisabled:true,\n        resourceStatus: OrderStatusData,\n        resourceDetailStatus: OrderDetailStatusData,\n        currentBillId: 0,\n        autoBoundBillId:0,\n        copy:function(){   //复制按钮的方法\n            //获得所有object\n            var alldata = $(\"#Grid\").data(\"kendoGrid\").dataSource.data();\n            // for(var i=0;i<alldata.length;i++){\n            //     alert(alldata[i].billCode);\n            // }\n\n            //获取多选值object\n            //var grid = $(\'#Grid\').data(\'kendoGrid\');   和下面一句效果一样\n            var grid = $(\"#Grid\").data(\"kendoGrid\") || {};\n            var checkData = grid.selectedDataItems();\n            if(!checkData.length) {\n                kendo.ui.showInfoDialog({\n                    title: \"提示\",\n                    message: \"请选择一行\"\n                });\n                return false;\n            }\n            else if(checkData.length > 1){\n                kendo.ui.showInfoDialog({\n                    title:\"提示\",\n                    message:\"每次只能复制一行\"\n                })\n            }\n            else{\n                $.ajax({\n                    async:false,   //ajax的执行原本是异步的，这个属性可以让Ajax执行完后再执行下一个Ajax\n                    type: \'POST\',\n                    url: \'${base.contextPath}/ord/material/order/get\',\n                    data: JSON.stringify(alldata),\n                    dataType:\"json\",\n                    contentType:\"application/json\",\n                });\n                $.ajax({\n                    async:false,\n                    type: \'POST\',\n                    url: \'${base.contextPath}/ord/material/order/copy\',\n                    data: JSON.stringify(checkData),\n                    dataType:\"json\",\n                    contentType:\"application/json\",\n                    success: function (data) {\n                        kendo.ui.showInfoDialog({\n                            title:\"提示\",\n                            message:\"复制成功\"\n                        })\n                        //刷新\n                        $(\'#Grid\').data(\'kendoGrid\').dataSource.page(1);\n                    },\n                    error:function(){\n                        kendo.ui.showInfoDialog({\n                            title:\"提示\",\n                            message:\"失败\"\n                        })\n                    }\n                });\n            }\n        }\n    });\n	\n	\n//Controller层\n\n\n\n@Autowired\nprivate MaterialOrderMapper orderMapper;\n\n    //get界面上所有billCode的方法   获取form中所有dto对象数据\n    List<MaterialOrder> saveList;\n    @RequestMapping(value = \"/ord/material/order/get\")\n    @ResponseBody\n    public ResponseData get(@RequestBody List<MaterialOrder> list, BindingResult result, HttpServletRequest request){\n        saveList = list;\n        return new ResponseData();\n    }\n    //copy方法    copy选中的dto\n    @RequestMapping(value = \"/ord/material/order/copy\")\n    @ResponseBody\n    public ResponseData copy(@RequestBody List<MaterialOrder> list, BindingResult result, HttpServletRequest request){\n        int i, num = 1;\n        MaterialOrder allDto;\n        for(i=0;i<saveList.size();i++){\n            allDto = saveList.get(i);\n            for (MaterialOrder dto:list){\n                if(allDto.getBillCode().equals((dto.getBillCode()+\"-\"+num))){\n                    num++;\n                    i = -1;\n                }\n            }\n        }\n        for(MaterialOrder sourceDto:list){\n            sourceDto.setBillCode(sourceDto.getBillCode()+\"-\"+num);\n            num = 1;\n            orderMapper.copy(sourceDto);\n        }\n        return new ResponseData();\n    }',1,1,'2022-04-10 13:01:18',-1,-1,'2022-04-10 13:01:18'),(7,10,'jvm调优','\ntop\n\n# 显示PID进程下所有线程信息，获取线程ID 10 进制\nps H -eo pid,tid,%cpu | grep 进程PID\n\n# 列举进程中所有Java线程，根据线程ID找到哪一个线程有问题（16进制）\njstack 进程PID\n\n# 显示Java进程堆信息\njmap -heap 进程PID',1,1,'2022-04-10 13:29:35',-1,-1,'2022-04-10 13:29:35'),(8,11,'Git命令','git branch\ngit branch -a  //查看本地和远程仓库\ngit pull\ngit checkout test1\ngit remote prune origin  //删除远程分支\ngit branch -d  //删除本地分支\ngit clone 地址  //拷贝项目到本地\n\n\ngit add .        //工作区的修改提交到暂存区\ngit status     //查看状态\n\n\n\n\n\n----------git上传\n工作区 ------暂停区------本地仓库-------远程仓库\nworkspace   index          local repository      remote repository\n\n命名\ngit-tutorial\n     <部门简称>-<工号>\n1在项目主页拷贝工程地址\ngit clone 地址\n2.进目录 \ncd wht_training\nls\ncd git-tutorial\ngit status\n\nls\nmkdir ora-2062     //建文件夹\ncd ora-2062\ntouch .gitkeep      //建一个隐藏文件,让git可以识别空文件夹  文件名为.gitkeep\ngit status\ngit add .   //提交文件夹下所有文件到暂停区\n\ngit rm --cached ora-2062/.gitkeep  //回到以前状态\ngit status\n\ngit commit  -m \"保留ora-2062文件夹\"  //从暂停区提交到本地仓库\ngit commit --no-verify -m \"XXX\"\n\ngit status\n\ngit push origin -u master  //提交到远程仓库       origin远程仓库默认别名 \n\nhttps://rdc.hand-china.com/gitlab/wh-training-2018\n\ngit clone\ncd git-tutorial\n\ngit remote -v //\n//建文件\ncd ora-2062/\nls\nech0 \"hello\" > README.txt\nls\ngit status\ngit add README.txt\ngit status\ngit commit -m \n\ngit commit -am  //提交到暂停区 加 提交到本地仓库\n\n-------------\ngit pull       //从远端拉取\ngit log                   //变更日志\ngit log --oneline    //变更日志\n\ngit diff       // 对比两次提交\n\nvim test.txt    //编辑\ncat text.txt    //显示\n\n\ngit branch\ngit branch -a\ngit branch -v\n\ngit checkout -b dev  //新建新分支dev\ngit checkout master  //移动head指向master分支\ngit merge dev        //合并分支 （向head指向的分支合并）\n\ngit branch -d dev    //删除分支（可能需要先合并分支）\n\n\ngithub使用流程\ngit init                                                        -- 初始化 \ngit remote add origin http://10.14.17.185/yang.gao/hzero-admin-1.3.5.release.git   -- 指定远程仓库\ngit remote set-url origin http://10.14.17.185:8086/qinghao.zhang/smart-business.git\n\ngit reset --soft HEAD^         取消commit\n或\ngit reset --soft HEAD~\n\ngit stash\ngit stash pop\n\ngit pull origin feature-26357 --allow-unrelated-histories\n\ngit commit --no-verify -m \"提交时的注释\"\n\ngit push -u origin feature-26357\n\n\n//创建并本地分支\n$ git checkout -b feature-halm-26357\n\n//推送本地的branch(冒号前面的)分支到远程origin的branchname(冒号后面的)分支(远程若没有会自动创建)\ngit push origin feature-halm-26357 feature-halm-26357\n\ngit pull origin develop    //拉远程develop分支代码-origin是远程分支的意思\n\n\ngit push origin feature-halm-26357   //推送本地已提交代码到远程的feature-halm-26357分支\n\n\n#  切换远程分支失败之前可以先将远程分支更新到本地\ngit fetch origin\ngit checkout -b feature-26357 origin/feature-26357 \n\n\n\n\n',1,1,'2022-04-10 13:31:07',-1,-1,'2022-04-10 13:31:07'),(9,12,'本版gat定指到支分retsam滚回TIG','Gitlab GIT master tag\n1\ngit branch\n2 master\ngit checkout master\n3\ngit tag v1.3.3 v1.3.4 v1.3.5\n4\ngit show v1.3.5\ncommit fb479960c0cec5549463ae123d70bdd72ccf6be7\n5 commit id\ngit reset --hard fb479960c0cec5549463ae123d70bdd72ccf6be7\n6\ngit log\n7\ngit reflog\n8\ngit status\n9\ngit push origin master\n10 git gitlab protected branches master protected设置\n11 push master git push origin master\n12 -f\ngit push -f origin master\nreset protected branches',1,1,'2022-04-10 13:33:13',-1,-1,'2022-04-10 13:33:13'),(10,13,'jdk8新用法','import dto.Phone;\nimport org.apache.commons.lang3.StringUtils;\nimport service.BaseService;\n\n\nimport java.math.BigDecimal;\nimport java.sql.SQLOutput;\nimport java.text.DateFormat;\nimport java.text.DecimalFormat;\nimport java.text.ParseException;\nimport java.text.SimpleDateFormat;\nimport java.util.*;\nimport java.util.stream.Collectors;\n\npublic class Main {\n    public static void main(String[] args) {\n        System.out.println(\"***********************java**********************\");\n\n        List<Phone> pL = new ArrayList<Phone>();\n        pL.add(new Phone(1, \"iPhone\"));\n        pL.add(new Phone(2, \"HUAWEI\"));\n        pL.add(new Phone(3, \"SAMSUNG\"));\n        pL.add(new Phone(4, \"MI\"));\n        pL.add(new Phone(5, \"OPPO\"));\n        pL.add(new Phone(6, \"VIVO\"));\n\n        // lambda 表达式基本用法\n        BaseService baseService = (a, b) -> { return a + b + \" SUCCESSS !\"; };\n\n\n        Map<String, List<Phone>> pM = pL.stream().collect(Collectors.groupingBy(Phone::getBrand));   // List 转 Map 按 Brand 分组\n		if(pM.size() > 0 && !Objects.isNull(pM.get(\"VIVO\"))){\n            System.out.println(pM.get(\"VIVO\").get(0).getBrand());\n        }\n		\n		\n        Map<Integer, String> pS = pL.stream().collect(Collectors.toMap(Phone::getPrice, Phone::getBrand));    // List 转 Map\n        Set<String> brand = pL.stream().map(Phone::getBrand).collect(Collectors.toSet());   // List 取出 Brand\n\n// 获取List中某个字符\nList<Long> orderMarkIfaceIds = orderMarkIfaces.stream().map(HomsOrderMarkIface::getId).collect(Collectors.toList());\n\nids.stream().distinct().collect(Collectors.toList());\n\n        pL.stream().forEach(p -> {\n            System.out.println(p);\n        });\n\n        System.out.println(\"***********************java**********************\");\n    }\n}\n\n\n\npublic class Phone {\n    public Phone(int price, String brand){\n        this.price = price;\n        this.brand = brand;\n    }\n    public static final String FIELD_PRICE = \"price\";\n    public static final String FIELD_BRAND = \"brand\";\n\n    private int price;\n\n    private String brand;\n\n    public int getPrice() {\n        return price;\n    }\n    public void setPrice(int price) {\n        this.price = price;\n    }\n\n    public String getBrand() {\n        return brand;\n    }\n    public void setBrand(String brand) {\n        this.brand = brand;\n    }\n}\n\n\n\nSystem.out.println(\"用户：\" + list);\n        double sum = list.stream().mapToDouble(User::getHeight).sum();\n        System.out.println(\"身高 总和：\" + df.format(sum));\n        double max = list.stream().mapToDouble(User::getHeight).max().getAsDouble();\n        System.out.println(\"身高 最大：\" + df.format(max));\n        double min = list.stream().mapToDouble(User::getHeight).min().getAsDouble();\n        System.out.println(\"身高 最小：\" + df.format(min));\n        double average = list.stream().mapToDouble(User::getHeight).average().getAsDouble();\n        System.out.println(\"身高 平均：\" + df.format(average));\n\n\nSystem.out.println(\"list：\" + list);\n        BigDecimal add = list.stream().map(User::getHeight).reduce(BigDecimal.ZERO, BigDecimal::add);\n        System.out.println(\"身高 总和：\" + df.format(add));\n        Optional<User> max = list.stream().max((u1, u2) -> u1.getHeight().compareTo(u2.getHeight()));\n        System.out.println(\"身高 最大：\" + df.format(max.get().getHeight()));\n        Optional<User> min = list.stream().min((u1, u2) -> u1.getHeight().compareTo(u2.getHeight()));\n        System.out.println(\"身高 最小：\" + df.format(min.get().getHeight()));\n\n\n\n\nareaDetails = areaDetails.stream().sorted(Comparator.comparing(HomsAreaDetail::getFinalZone).thenComparing(HomsAreaDetail::getPriority)).collect(Collectors.toList());\n\n// 升序\nList<String> list = new ArrayList<>();\n        list.add(\"1\");\n        list.add(\"1\");\n        list.add(\"1\");\n        list.add(\"4\");\n        list.add(\"1\");\n        list.add(\"3\");\n        list.add(\"2\");\n        list.add(\"7\");\n        list.add(\"8\");\n        list.add(\"1\");\n\n        list.stream()\n                .sorted()\n                .forEach(o -> System.out.println(o));\n// 降序\nlist.stream()\n                .sorted(Comparator.reverseOrder())\n                .forEach(o -> System.out.println(o));\n\n\n',1,1,'2022-04-13 11:40:42',-1,-1,'2022-04-13 11:40:42'),(11,14,'查看mysql BLOB类型数据','SELECT ahp.proc_inst_id_,\nahp.start_user_id_,\niu.real_name start_user_name,\n(\nCASE aha.act_type_\nWHEN \'startEvent\' THEN ahp.start_user_id_\nWHEN \'userTask\' THEN aht.assignee_\nELSE \'\' END\n) assignee_,\n(\nCASE aha.act_type_\nWHEN \'startEvent\' THEN iu.real_name\nWHEN \'userTask\' THEN as_iu.real_name\nELSE \'\' END\n) assignee_user_name,\nahp.proc_description,\n(\nCASE aha.act_type_\nWHEN \'startEvent\' THEN \'开始\'\nWHEN \'endEvent\' THEN \'结束\'\nWHEN \'userTask\' THEN aht.name_\nELSE \'\' END\n) node_name,\n(\nCASE ahc2.message_\nWHEN \'Approved\' THEN \'审批通过\'\nWHEN \'Rejected\' THEN \'审批拒绝\'\nELSE \'\' END\n) active,\nCONVERT (ahc1.full_msg_ USING utf8) AS full_msg_,\n(\nCASE aha.act_type_\nWHEN \'startEvent\' THEN aha.start_time_\nWHEN \'userTask\' THEN ahc1.time_\nELSE \'\' END\n) start_time_\nFROM act_hi_procinst ahp\nLEFT JOIN iam_user iu ON iu.login_name = ahp.start_user_id_\nLEFT JOIN act_hi_actinst aha ON aha.proc_inst_id_ = ahp.proc_inst_id_\nLEFT JOIN act_hi_taskinst aht ON aht.id_ = aha.task_id_\nLEFT JOIN iam_user as_iu ON as_iu.login_name = aht.assignee_\nLEFT JOIN act_hi_comment ahc1 ON ahc1.task_id_ = aht.id_ AND ahc1.type_ = \'comment\'\nLEFT JOIN act_hi_comment ahc2 ON ahc2.task_id_ = aht.id_ AND ahc2.type_ = \'action\'\nWHERE 1 = 1\nAND aha.act_type_ != \'exclusiveGateway\' \nAND aha.act_type_ != \'endEvent\'\nORDER BY ahp.proc_inst_id_ ASC\n',1,1,'2022-04-13 17:36:33',-1,-1,'2022-04-13 17:36:33'),(12,15,'bigdecimal比较大小','BigDecimal a = new BigDecimal (101.00);\nBigDecimal b = new BigDecimal (111.00);\nif(a.compareTo(b) == -1){\nSystem.out.println(\"a小于b\");\n}\n\nif(a.compareTo(b) == 0){\nSystem.out.println(\"a等于b\");\n}\n\nif(a.compareTo(b) == 1){\nSystem.out.println(\"a大于b\");\n}\n\nif(a.compareTo(b) > -1){\nSystem.out.println(\"a大于等于b\");\n}\n\nif(a.compareTo(b) < 1){\nSystem.out.println(\"a小于等于b\");\n}',1,1,'2022-04-20 10:30:29',-1,-1,'2022-04-20 10:30:29'),(13,16,'FileChannel拷贝文件','public static void copyFile(File sourceFile, File destFile) throws IOException {\n\n    if(!destFile.exists()) {\n\n} \n}\ndestFile.createNewFile();\nFileChannel source = null;\nFileChannel destination = null;\ntry {\nsource = new FileInputStream(sourceFile).getChannel();\ndestination = new FileOutputStream(destFile).getChannel();\ndestination.transferFrom(source, 0, source.size());\n\n        }\n\n        if(destination != null) {\n\n        }\n\n    }\n\nfinally {\n    if(source != null) {\nsource.close();\ndestination.close();\n}',1,1,'2022-08-29 14:19:31',-1,-1,'2022-08-29 14:19:31');
